import React, { useState } from 'react';
import * as XLSX from 'xlsx';
import FileSaver from 'file-saver';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import ScheduleGenerator from './ScheduleGenerator';
import ScheduleViewer from './ScheduleViewer';

function Home() {
  const [file, setFile] = useState(null);
  const [startDate, setStartDate] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleFileUpload = (e) => {
    const uploadedFile = e.target.files[0];
    setFile(uploadedFile);
  };

  const handleGenerateSchedule = async () => {
    if (!file || !startDate) {
      alert("Ë´ã‰∏äÂÇ≥ Excel ‰∏¶Ëº∏ÂÖ•ÈñãÂßãÊó•ÊúüÔºÅ");
      return;
    }

    setLoading(true);
    try {
      // ‰øùÂ≠ò‰∏ä‰º†ÁöÑÊñá‰ª∂
      const formData = new FormData();
      formData.append('file', file);
      
      // Ë∞ÉÁî®ÂêéÁ´ØAPI
      const response = await fetch('/api/generate-groups', {
        method: 'POST',
        body: formData
      });

      if (!response.ok) {
        throw new Error('ÁîüÊàêÂàÜÁµÑÂ§±Êïó');
      }

      const result = await response.json();
      
      // ÂàõÂª∫ExcelÊñá‰ª∂
      const workbook = XLSX.utils.book_new();
      
      // Ê∑ªÂä†ÂàÜÁªÑÊï∞ÊçÆ
      const groupingSheet = XLSX.utils.json_to_sheet(result.grouping_data);
      XLSX.utils.book_append_sheet(workbook, groupingSheet, "Groupings");
      
      // Ê∑ªÂä†Ë£ÅÂà§ÂÜ≤Á™ÅË°®
      const refConflictSheet = XLSX.utils.json_to_sheet(result.ref_conflict_data);
      XLSX.utils.book_append_sheet(workbook, refConflictSheet, "Referee Conflicts");
      
      // ËæìÂá∫Êñá‰ª∂
      const wbout = XLSX.write(workbook, { type: "array", bookType: "xlsx" });
      FileSaver.saveAs(new Blob([wbout], { type: "application/octet-stream" }), "group_generate.xlsx");
      
      // Ë∑≥ËΩ¨Âà∞ÊéíÁ®ãÈ°µÈù¢
      navigate('/schedule-generator', { state: { startDate } });
    } catch (error) {
      console.error("Error:", error);
      alert(error.message || "ÁîüÊàêÈÅéÁ®ã‰∏≠ÁôºÁîüÈåØË™§ÔºåË´ãÊ™¢Êü•Ê™îÊ°àÊ†ºÂºèÊòØÂê¶Ê≠£Á¢∫„ÄÇ");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-stripe font-sans">
      {/* Â∑¶‰∏äËßíÂñÆ‰∏ÄÊéíÁêÉ Emoji */}
      

      {/* ÂâçÊôØÂÖßÂÆπ */}
      <div className="bg-white shadow-xl rounded-2xl p-8 w-full max-w-xl border-4 border-yellow-400 relative z-10">
        <h1 className="text-3xl font-extrabold text-blue-900 text-center mb-6">üèê Âè∞Â§ßÁõÉÊéíÁêÉË≥ΩÁ®ãÁîüÊàêÂô®</h1>

        <div className="mb-4">
          <label className="block text-blue-900 font-extrabold mb-2">üìÇ ‰∏äÂÇ≥ Excel Ê™îÊ°àÔºö</label>
          <input
            type="file"
            accept=".xlsx"
            onChange={handleFileUpload}
            className="w-full p-2 border-2 border-yellow-300 rounded-md bg-blue-50"
          />
        </div>

        <div className="mb-4">
          <label className="block text-blue-900 font-extrabold mb-2">üìÖ Ëº∏ÂÖ•Ëµ∑ÂßãÊó•ÊúüÔºö</label>
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="w-full p-2 border-2 border-yellow-300 rounded-md bg-blue-50"
          />
        </div>

        <button
          onClick={handleGenerateSchedule}
          disabled={loading}
          className={`w-full py-3 px-4 bg-yellow-400 hover:bg-yellow-500 text-blue-900 font-bold rounded-lg transition duration-200 shadow-md ${
            loading ? 'opacity-50 cursor-not-allowed' : ''
          }`}
        >
          {loading ? 'ÁîüÊàê‰∏≠...' : 'ÁîüÊàêÂàÜÁµÑÂíåË£ÅÂà§Ë°ùÁ™ÅË°®'}
        </button>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/schedule-generator" element={<ScheduleGenerator />} />
        <Route path="/schedule-viewer" element={<ScheduleViewer />} />
      </Routes>
    </Router>
  );
}

export default App;
